import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

const Nav = styled.nav`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  width: 100%;
`;

const NavbarNav = styled.menu`
  border: 1px solid red;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  justify-content: space-between;
  align-items: center;
  flex: 1;
`

const Brand = styled.div`
  background: ${props => props.theme.colors.primary};
  width: 200px;
  > img {
    width: 100%;
  }
`

function Navbar() {
  return (
    <>
      <nav>
        <ul className="menu">
          <li className="logo">
            <Brand>
              <img src="/images/Logo.png" alt="my image" />
            </Brand>
          </li>
          <li className="item"><a href="#">Home</a></li>
          <li className="item"><a href="#">About</a></li>
          <li className="item"><a href="#">Services</a></li>
          <li className="item"><a href="#">Features</a></li>
          <li className="item"><a href="#">Blog</a></li>
          <li className="item"><a href="#">Contact</a>
          </li>
          <li className="item button"><a href="#">Log In</a></li>
          <li className="item button secondary"><a href="#">Sign Up</a></li>
          <li className="toggle"><a href="#"><i className="fas fa-bars"></i></a></li>
        </ul>
      </nav>
      {/* <Nav>
        <Brand>
          <img src="/images/Logo.png" alt="my image" />
        </Brand>

        <NavbarNav>
          <Link href="/">
            <a>Home</a>
          </Link>
          <Link href="/about">
            <a>About</a>
          </Link>
        </NavbarNav>
      </Nav> */}
    </>
  )
}

export default Navbar
